start transaction;

create table drones (
  drone_id integer primary key,
  firmware varchar(255),
  last_maintenance date
);

create table drone_activities (
  drone_activity_id integer primary key,
  drone_id integer references drones(drone_id) deferrable,
  date date,
  flying_minute integer,
  docking_minute integer,
  planting_minute integer,
  gardening_minute integer,
  na_minute integer
);

create table areas (
  area_id integer primary key,
  surface float,
  name varchar(255)
);

create table trees (
  tree_id integer primary key,
  area_id integer references areas(area_id) deferrable,
  drone_id integer references drones(drone_id) deferrable,
  species varchar(255),
  planting_date date
);





commit;

